> ### This method authenticate a secretary.

> **POST** _/secretario/authenticate

- **Request**


  > - Type: ***application/json***
  > - Body: 
        {
             required "email": string,
             required "senhaAcesso": string, 
        }


- **Response**


>     
    "secretario": {
        "email": string,
        "senhaAcesso": string,
        "message": string,
                     {
                     "Usuário ou Senha inválidos": failure,
                     }
    "token": {
             "_id": _id,
             "data":{
             "email": string,
             "nome":     {
                          "nomeCompleto"
                         }
                    }
             "message": string,
               {
             "não foi possível autenticar o usuário": failure
              }
            }
            }

> ### This method authenticate a doctor.

> **POST** _/medico/authenticate

- **Request**


  > - Type: ***application/json***
  > - Body: 
           {
             required "email": string,
             required "senhaAcesso": string, 
           }


  - **Response**


>     
    "medico": {
        "email": string,
        "senhaAcesso": string,
        "message": string,
                     {
                     "Usuário ou Senha inválidos": failure,
                     }
    "token": {
             "_id": _id,
             "data":{
                   "email": string,
                   "nome":  {
                           "nomeCompleto"
                            }
                    }
             "message": string,
                 {
                 "não foi possível autenticar o usuário": failure
                 }
            }
            }

> ### This method registers the schedule in the database.

> **POST** _/agenda/:id

- **Request**

  > - Note: **You can register the schedule, sending the desired data in the request body.**
  > - Type: ***application/json***
  > - Body: 
        {
             required "dia": string,
             required "periodo": string,
             required "horario": string
        }


   - **Response**



  > - Note: **Examples of success and failure messages.**


>     
    "data": {
          "mensage": string,
               {
                "Agenda cadastrada": success,
               }
    }
    "error": {
           "mensage":string,
               {
                "Erro ao cadastrar a agenda.": failure,
               }
    }

